    _form: '\Drupal\complinetmigration\Form\xmlparser'
  requirements:
    _permission: 'administer content'
notices.form:
  path:  '/admin/noticesparser/form'
  defaults:
    _form: '\Drupal\complinetmigration\Form\noticesparser'
